import React from 'react';
import { Container } from 'react-bootstrap';

const Interpelacje = () => {
  return (
    <Container>
      <h1>Interpelacje</h1>
      <p>Informacje o interpelacjach.</p>
    </Container>
  );
};

export default Interpelacje;
